/* csql_yylex_destroy is for both reentrant and non-reentrant scanners. */
int csql_yylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		csql_yy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		csql_yypop_buffer_state();
	}

	/* Destroy the stack itself. */
	csql_yyfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * csql_yylex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

